import React, { Component} from 'react';
import { Link } from "react-router-dom";
import { Button } from '@material-ui/core';

export default class Servicios extends Component {
    render() {
        return (
            <div>
                <Link to={"/test/" +1}>
                    <Button variant="contained" color="primary" >
                        Ver Propiedad
                    </Button>
                </Link>
            </div >
        );
    }
}
